canonical_solution:
class Solution:
    def divideArray(self, nums: List[int]) -> bool:
        cnt = Counter(nums)
        return all(v % 2 == 0 for v in cnt.values())

inefficient_solution:
class Solution:
    def divideArray(self, nums: List[int]) -> bool:
        values = []
        for num in nums:
            values.append(num)
            values.append(num)

        pairs = []
        for i in range(0, len(values), 2):
            pairs.append((values[i], values[i+1]))

        counts = {}
        for pair in pairs:
            if pair[0] not in counts:
                counts[pair[0]] = 0
            if pair[1] not in counts:
                counts[pair[1]] = 0
            counts[pair[0]] += 1
            counts[pair[1]] += 1

        for value in counts.values():
            if value % 2 != 0:
                return False

        return True
